import axios from 'axios'
export const topic = async (data) => {
    return new Promise(async (resolve, reject) => {
      try {
        const response = await axios.get("http://localhost:3000/topic");
        console.log(data);
        resolve(response.data);        
      } catch (err) {
        reject(err);
      }
    });
  };
